import React, {useState} from "react";
import GetAccountById from "./AccountPage/GetAccountByID";
import axios from "axios";
import GetAccountByID from "./AccountPage/GetAccountByID";

function HomePage() {

    const [ID, setID] = useState('');
    const [ResultID, setResultID] = useState('');

    const handleIDChange = (e) => {
        setID(e.target.value);
    };
    const handleResultIDChange = () => {
        setResultID(ID);
    };

    return (
        <div>
            <label><b>User ID</b></label>
            <input type="text" placeholder="Enter ID" name={"ID"} value={ID} onChange={handleIDChange} required/>
            <button type="submit" onClick={handleResultIDChange}>Find account</button>
            
            <GetAccountByID ID={ResultID}/>
        </div>
    );
}
export default HomePage;
